export default function Header() {
  return (
    <header className="header">
          <div className="wrap">
              <h2>Beleza</h2>
              <h1><a href="#">
                <img src="./public/images/propz-logo.svg" alt="Propz" /></a>
              </h1>
          </div>               
    </header>
  );
}
